import React from 'react'
import {Amount,AmountText,AmountWrapper,ViewRedirect,Arrow} from './style';

export default function BalanceComponent(props) {
    return (
        <AmountWrapper>
            <AmountText>Current Balance</AmountText>
            <i style={{fontStyle:"oblique"}}className="fa fa-info-circle"></i>
            <Tooltip></Tooltip>
            <Amount><span>&#36;</span>120,000</Amount>
            <ViewRedirect visible={props.redirect} href="#">VIEW TRANSACTION SUMMARY<Arrow>&#10142;</Arrow></ViewRedirect>
        </AmountWrapper>
    )
}
